import { useEffect, useState } from "react";
import { Navigate } from "react-router-dom";
import door from '../images/door.png';
import validate from '../services/validateToken';
import { useNavigate } from "react-router-dom";
import { Footer, Navbar } from ".";
import gandalf from '../images/gandalf.gif';

const Moria = ({token}) => {
    //implement token axios post request
    const [userDetails,setuserDetails] = useState();
    const tokenString = localStorage.getItem('token');
    const userToken = JSON.parse(tokenString);    
    const navigate = useNavigate();

    useEffect(() => {
        const fetchData = async () => {
            const userData = await validate(userToken);
            console.log(userData)
            setuserDetails(userData['message']);
            sessionStorage.setItem('k',JSON.stringify(userData['k']));
        };
        fetchData();
    }, []);
    if (!userDetails){
        navigate('/');
    } else {
        return (

            <div>
            <div  className=" flex w-full justify-center items-center  bg-gradient-to-r from-slate-500 to-blue-900">
                <div className="relative  basis-1/2">
                <h1 className="italic text-3xl sm:text-5xl text-white text-gradient  py-3">
                Well done Traveler {userDetails}! <img src={gandalf}  alt="" className="w-23 object-top cursor-pointer"/>
            </h1>
                </div>
            </div>
            <Footer />
            </div>
        )
    }
};

export default Moria;
